Hey Friends, I’m doing a garden tour starting next week Monday with some friends here on Instagram! 

Join us as we each share our summer gardens in our stories and our 3 THINGS! 3 things we’ve learned in the garden recently or 3 things we are loving in the garden! Come and be encouraged and inspired to get into your own garden or start a garden! Come learn from new and seasoned gardeners! 

